INSERT INTO `curriculums` VALUES ('1', '信息科学技术概论', '/web/upfile/20170119/1484791273286622800.png', '', '普通课', '课程以信息学科自身、信息与其他学科的交叉发展为背景，引导学生“入大学学习之门”，主要内容是信息科技的内容、历史、作用和趋势，并与基础学科、国家战略、艺术创造等内容相交叉。', '20', '0', '081202', '2017-01-19 10:01:37');
INSERT INTO `curriculums` VALUES ('2', '数据结构基础', '/web/upfile/20170119/1484791843162217800.png', '', '普通课', '数据结构基础', '20', '0', '081203', '');
INSERT INTO `curriculums` VALUES ('3', '线性代数与信息科技', '/web/upfile/20170119/1484792927304227200.png', '', '普通课', '线性代数是所有理工科专业大一学生的基础课，而信息科学是一门新兴综合性学科，其研究由信息、控制、电子计算机、人工智能等相互渗透、相互结合而成。线性代数是将理论、应用和计算融合在一起的完整数学体系。在信息科学的研究中，线性代数发挥着越来越重要的作用。隐身飞机设计等电磁应用、人脸识别、智能机器研制、搜索引擎、图像处理，这些看似毫不相关的科技，在其研制过程中却都运用到了线性代数的知识。本课程以大一线性代数知识来初步接触现代信息科技前沿的若干方面为目的，为数学基础课学习与前沿科学研究这一鸿沟搭建桥梁。每一讲从讨论上', '20', '0', '081202', '');
INSERT INTO `curriculums` VALUES ('4', '口腔常见疾病的诊治', '/web/upfile/20170119/1484812964595294700.png', '', '普通课', '《口腔科学》课程主要对口腔颌面部解剖生理、牙体牙周组织常见病、口腔黏膜疾病、口腔局部麻醉与拔牙术、口腔颌面部损伤与感染、唾液腺疾病、颞下颌关节疾病、口腔颌面部常见肿瘤、老年口腔疾病及全身系统性疾病在口腔的表现以及诊断治疗技术等进行了较为全面的阐述。', '4', '0', '1001', '2017-01-19 16:02:58');
