-- ----------------------------
-- Procedure structure for Addkebd
-- ----------------------------
DROP PROCEDURE IF EXISTS `Addkebd`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `Addkebd`(in dclassid int,in dCurricuid int,in dUsersId int,in Classroomid int,in inIslive int,in inIsondemand int,in inIscomment int,in inIscheckcomment int)
begin

declare maxid int;
declare classnum int;
declare chaptersId int;
declare dChaptername varchar(200);
declare dChapterdetails varchar(4000);
declare dChaptericon varchar(200);
declare ccccmaxid int;
declare teachingrecordid int;
declare stdid int;
declare indexnum int;
  
  DECLARE t_error INTEGER DEFAULT 0;
  declare done INT DEFAULT FALSE;
  /*
  declare stddone int default false;
  */
  /*
  declare continue handler for not found set stddone=true;
  */
  declare mycur cursor for select id,Chaptername,Chapterdetails,Chaptericon from chapters where Curriculumsid=dCurricuid;
  /*
  declare classuser cursor for select Id from students where Classesid=classid;
  */
  declare CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;
   
  START TRANSACTION;/*启动事务*/
  SET AUTOCOMMIT=0;/*设置不自动提交*/
  
  values(dCurricuid,dclassid,dUsersId,NOW(),0,0,0,inIslive,inIsondemand,0,0,0,0);
  /*select maxid=max(Id) from curriculumsclasscentre;*/
  set maxid=@@IDENTITY;
 /*set classnum=(select Classesnum from classes where Id=dclassid);*/
 set classnum=(select count(*) from students where Classesid=dclassid);
 set indexnum=1; 
 if classnum <= 0 then
 set classnum=(select Classesnum from classes where Id=dclassid);
 end if;
  open mycur;
  
   read_loop: LOOP
    /*提取游标里的数据，这里只有一个，多个的话也一样；*/
    FETCH mycur INTO chaptersId,dChaptername,dChapterdetails,dChaptericon;
    /*声明结束的时候*/
    IF done THEN
      LEAVE read_loop;
    END IF;
    /*这里做你想做的循环的事件)*/
     
    -- values(maxid,chaptersId,classnum,0,0,dUsersId,inIslive,inIsondemand,now(),date_add(now(), interval indexnum day),date_add(now(), interval indexnum day),0);
		values(maxid,chaptersId,classnum,0,0,dUsersId,inIslive,inIsondemand,now(), '', '', 0);

    set ccccmaxid=@@IDENTITY;
    set indexnum=indexnum+1;
    if inIslive >0 || inIsondemand>0 then
    
    values(ccccmaxid,dChapterdetails,dChaptername,'','','',dChaptericon,0,1,now(),0,'',inIscomment,inIscheckcomment,0,0,0,0);
    end if;
    /*select teachingrecordid=max(Id) from teachingrecord;*/
    set teachingrecordid=@@IDENTITY;
        
    call Addkebdpointtos(dclassid,ccccmaxid);

  END LOOP;
  /*关闭游标*/
  CLOSE mycur;
  IF t_error = 1 THEN
    ROLLBACK;
  ELSE
    COMMIT;
  END IF;
  /*
  COMMIT;
  */
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for Addkebdpointtos
-- ----------------------------
DROP PROCEDURE IF EXISTS `Addkebdpointtos`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `Addkebdpointtos`(in dclassid int,in ccccmaxid int)
begin
  declare maxpointtosid int;
  declare stdid int;
  declare stddone int default false;
  declare classuser cursor for select Id from students where Classesid=dclassid;
  declare continue handler for not found set stddone=true;
    
    open classuser;
    
    classuser_loop:loop
    
    fetch classuser into stdid;
      IF stddone THEN
        LEAVE classuser_loop;
      END IF;
      
     end loop;
     close classuser;

end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for Delkebd
-- ----------------------------
DROP PROCEDURE IF EXISTS `Delkebd`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `Delkebd`(in Cid int)
BEGIN
  declare dCurriculumclassroomchaptercentreid int;
  DECLARE t_error INTEGER DEFAULT 0;
  declare done INT DEFAULT FALSE;


  declare mycurz cursor for select Id from Curriculumclassroomchaptercentre where Curriculumsclasscentreid=Cid;

  declare CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;
  open mycurz;
  
   read_loop: LOOP
    FETCH mycurz INTO dCurriculumclassroomchaptercentreid;
    IF done THEN
      LEAVE read_loop;
    END IF;
    select Curriculumclassroomchaptercentreid;
    delete from teachingrecord where Curriculumclassroomchaptercentreid in(dCurriculumclassroomchaptercentreid);
    delete from pointtos where Curriculumclassroomchaptercentreid in(dCurriculumclassroomchaptercentreid);
    
  END LOOP;
  CLOSE mycurz;
  delete from curriculumclassroomchaptercentre where Curriculumsclasscentreid=Cid;
  delete from Curriculumsclasscentre where Id=Cid;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for func_sequence
-- ----------------------------
DROP FUNCTION IF EXISTS `func_sequence`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `func_sequence`(`tb_name` varchar(64)) RETURNS bigint(20)
BEGIN
	ON DUPLICATE KEY UPDATE table_id = LAST_INSERT_ID(table_id +1);
	RETURN LAST_INSERT_ID();
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getDeviceModelChildNodes
-- ----------------------------
DROP FUNCTION IF EXISTS `getDeviceModelChildNodes`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getDeviceModelChildNodes`(nodeId varchar(50)) RETURNS varchar(4000) CHARSET gbk
BEGIN
/*
就写这么几句的一个函数，花了我一个上午的时间才调试通过，教训是深刻的，究竟原因出在：函数的输入参数不能与表的字段名相同，如果相同则取不到字段的值。
*/
DECLARE sTemp VARCHAR(8000);
DECLARE sTempChd VARCHAR(8000);

set sTemp = '$';
set sTempChd = nodeId;

WHILE sTempChd is not NULL DO
  SET sTemp = CONCAT(sTemp,',',sTempChd);
  SELECT group_concat(id) INTO sTempChd FROM devicemodel where FIND_IN_SET(pId,sTempChd)>0;
END WHILE;

RETURN sTemp;

END
;;
DELIMITER ;
